import React, { Component } from 'react';
import Homepage from './components/tabs/Homepage';
import Nav from './components/layout/Nav';

class App extends Component {
	render() {
		return (
			<React.Fragment>
				<Homepage />
			</React.Fragment>
		);
	}
}

export default App;
